INSERT INTO st_email_template VALUES (2, '[Admin Name]', '[Admin Email]', 'Your User Record Has Been Updated By Administrator', 'Hi [User Name],\n\nYour user record has been updated by the Administrator.\n\n\nregards,\n[Admin Name]', 'admin_user_updated', 'User Record Update Notification');
INSERT INTO st_email_template VALUES (3, '[Admin Name]', '[Admin Email]', 'Your account has been deleted by Administrator', 'Hi [User Name],\n\nYour account in Socket Timesheet has been deleted by the Administrator.\n\n\nregards,\n[Admin Name]', 'admin_user_deleted', 'User Deleted Notification');
