INSERT INTO st_email_template VALUES (6, '[PM Name]', '[PM Email]', 'Project: [Project Name] Added', 'Hi,\n\nProject [Project Name] has been added.\n\nProject Manager \n[PM Name]\n\nTeam Members\n[Team Name]\n\nStart Date\n[Start Date]\n\nEnd Date\n[End Date]\n\n\nregards,\n[PM Name]', 'project_added', 'New Project Added Notification');
INSERT INTO st_email_template VALUES (7, '[PM Name]', '[PM Email]', 'Project: [Project Name] Updated', 'Hi,\n\nProject [Project Name] has been updated by Project Manager.\n\nProject Manager \n[PM Name]\n\nTeam Members\n[Team Name]\n\n\nregards,\n[PM Name]', 'project_updated', 'Project Updated Notification');
INSERT INTO st_email_template VALUES (8, '[PM Name]', '[PM Email]', 'Project: [Project Name] Deleted', 'Hi,\n\nProject [Project Name] has been deleted by Project Manager.\n\nProject Manager \n[PM Name]\n\nTeam Members\n[Team Name]\n\n\nregards,\n[PM Name]', 'project_deleted', 'Project Deleted Notification');
INSERT INTO st_email_template VALUES (9, '[PM Name]', '[PM Email]', 'Project: [Project Name] Is Now Starting', 'Hi,\n\nProject [Project Name] is now starting.\n\nProject Manager \n[PM Name]\n\nTeam Members\n[Team Name]\n\nStart Date [Start Date]\n\n\nregards,\n[PM Name]', 'project_started', 'Project Started Notification');
INSERT INTO st_email_template VALUES (10, '[PM Name]', '[PM Email]', 'Project: [Project Name] Has Reached The End Date', 'Hi,\n\nProject [Project Name] has reached the end date.\n\nProject Manager \n[PM Name]\n\nTeam Members\n[Team Name]\n\nEnd Date: [End Date]\n\n\nregards,\n[PM Name]', 'project_ended', 'Project End Date Notification');
INSERT INTO st_email_template VALUES (11, 'Timesheet Email Notification', '[User Email]', 'Timesheet Submitted', 'Hi,\n\nTimesheet for week [Week] has been submitted by [User Name].\n\nTasks\n[Timesheet Tasks]\n\nTimeoff\n[Timeoff Tasks]\n\nOverall\n[Overall Status]\n\n\nregards,\nTimesheet Email Notification', 'timesheet_approval', 'Timesheet Submitted Notification');
