INSERT INTO st_email_template VALUES (13, 'Timesheet Email Notification', '[Admin Email]', 'Timesheet Rejected', 'Hi,\n\nYour timesheet submission for the week of [Week] has been rejected. Current status below:\n\nTasks\n[Timesheet Tasks]\n\nTimeoff\n[Timeoff Tasks]\n\nOverall\n[Overall Status]\n\n\nregards,\nTimesheet Email Notification', 'timesheet_rejected', 'Timesheet Rejection Notification');
INSERT INTO st_email_template VALUES (14, 'Timesheet Email Notification', '[User Email]', 'Timesheet Undo Request', 'Hi,\n\nUser [User Name] has submitted a Timesheet Undo Request for the week of [Week]. Kindly take appropriate action.\n\n\nregards,\nTimesheet Email Notification', 'timesheet_undo_request', 'Timesheet Undo Request Notification');
INSERT INTO st_email_template VALUES (15, 'Timesheet Email Notification', '[User Email]', 'Timesheet Undo Request Cancellation', 'Hi,\n\nFYI, User [User Name] has cancelled Undo Request for the week of [Week].\n\n\nregards,\nTimesheet Email Notification', 'timesheet_undo_cancel', 'Timesheet Undo Request Cancellation Notification');
INSERT INTO st_email_template VALUES (16, '[Admin Name]', '[Admin Email]', 'Timesheet Undo by Administrator', 'Hi [User Name],\n\nYour Timesheet for the week of [Week] has been Undo by the Administrator.\n\n\nregards,\n[Admin Name]', 'timesheet_undo_approved', 'Timesheet Undo Approved Notification');
INSERT INTO st_email_template VALUES (17, 'Timesheet Email Notification', '[Admin Email]', 'Your Timesheet Is Due', 'Hi [User Name],\n\nYour timesheet for the week of [Week] is now due for submission. Please take appropriate action.\n\n\nregards,\nTimesheet Email Notification', 'timesheet_due', 'Timesheet Due Notification');
INSERT INTO st_email_template VALUES (18, 'Timesheet Email Notification', '[Admin Email]', 'Your Timesheet Is Overdue', 'Hi [User Name],\n\nYour timesheet for the week of [Week] is now overdue. Please take appropriate action ASAP.\n\n\nregards,\nTimesheet Email Notification', 'timesheet_overdue', 'Timesheet Overdue Notification');
INSERT INTO st_email_template VALUES (19, 'Expenses Email Notification', '[Admin Email]', 'Expenses Submitted By [User Name]', 'Hi,\n\nExpenses submitted by [User Name]\n\nDescription\n[Expenses Description]\n\nOverall Status\n[Overall Status]\n\n\nregards.\nExpenses Email Notification', 'expenses_approval', 'Expenses Submitted Notification');
